const inputField = document.querySelector('.input-field')
const list = document.querySelector('#list-wrap')
const counter = document.querySelector('#count')

let todoArr = []
let todo =  {
  description: String,
  completed: false,
}

class UI {
   static addTodo () {
        if (inputField.value.length !== 0 ) {
            todo.description = inputField.value;
            todoArr.push(todo);
            inputField.value = ''
            console.log(todoArr)
            for(let i = 0; i < todoArr.length; i += 1) {
              todoArr[i].index = i + 1;
          }
            localStorage.setItem('todos', JSON.stringify(todoArr));
          }
        }

   static displayTodos () {
        let todos = JSON.parse(localStorage.getItem('todos'));
        counter.textContent = todos.length;
        if (todos){
            todoArr = todos
        }
        let result = ''
        todoArr.map(todo => {
            result += `
        <li id=${todo.index} class="list-item">
            <form id=${todo.index} class='edit-todo' action="">
                <div class="label-wrap">
                    <label for="checkbox">
                        <input class="checkbox" type="checkbox" name="checkbox" id=${todo.index}>
                    </label>
                    <label for=${todo.index}>
                        <input class="input" type="text" name="add-item" id=${todo.index} value="${todo.description}">
                    </label>
                </div>
                </form>
                <button id=${todo.index} class="drag">remove</button>
        </li>
              `;
         return result;
        })
         
        list.innerHTML = result;
        return result
      }

     static removeTodo (e) {
        const deleteBtns = [...document.querySelectorAll('.drag')]
        deleteBtns.forEach(btn => {
          if(e.target === btn) {
            let filteredArr = todoArr.filter(item => item.index.toString() !== e.target.id.toString())
            todoArr = filteredArr
            localStorage.setItem('todos', JSON.stringify(todoArr))
            UI.displayTodos()
          }
          
        })
      }

      editTodo (e) {
        const editTodos = [...document.querySelectorAll('.input')]
        console.log(editTodos)
        editTodos.forEach(todo => {
          if(e.target === todo) {
            let item = todoArr.find(item => item.index.toString() === e.target.id.toString())
            console.log(e.target)
            console.log(item)
            item.description = e.target.value;
            
            localStorage.setItem('todos', JSON.stringify(todoArr))
          }
        })
    }

}
    


